import React from "react";
import Layout from "../components/Layout";

const Analyser = () => {
  return (
    <Layout>
      <div style={{ padding: "2rem" }}>
        <h2>Mine analyser</h2>
        <p>Her kan du se tidligere analyser (kommer snart).</p>
      </div>
    </Layout>
  );
};

export default Analyser;
